import React, {useState} from "react";
import { NavLink } from 'react-router-dom';
import Nav from 'react-bootstrap/Nav';
import styled from "styled-components";
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { HashLink } from 'react-router-hash-link';
import { device } from "../utils";
import Container from 'react-bootstrap/Container';
import { motion } from 'framer-motion/dist/framer-motion';

import Logo from "../assets/favicon.png";

function Header() {

    const [show, setShow] = useState(false);
    const showDropdown = (e)=>{
        setShow(!show);
    }
    const hideDropdown = e => {
        setShow(false);
    }

    const MenuDropdown = styled.ul`
    list-style: none;
    @media ${device.lg} {
      top: 110%;
      position: absolute;
      min-width: 227px;
      max-width: 227px;
      box-shadow: 0 52px 54px rgba(65, 62, 101, 0.3);

      background-color: ${({ dark, theme }) => theme.colors.light};
      padding: 15px 0px;
      z-index: 99;
      opacity: 0;
      transition: opacity 0.4s, top 0.4s;
      pointer-events: none;
      left: -90%;
      border: 1px solid #e5e5e5;
      border-radius: 0 0 10px 10px;
      display: block;
      border-top: ${({ theme }) => `3px solid ${theme.colors.primary}`};
    }
    > .drop-menu-item {
      color: ${({ theme }) => theme.colors.dark};
      font-size: 15px;
      font-weight: 300;
      letter-spacing: -0.5px;
      padding-left: 30px;
      padding-right: 30px;
      padding-top: 10px;
      padding-bottom: 10px;

      a {
        color: ${({ theme }) => theme.colors.dark} !important;
        transition: all 0.3s ease-out;
        position: relative;
        display: flex;
        align-items: center;
        font-weight: 700;
        text-transform: lowercase;
        &.dropdown-toggle::after {
          margin-left: 10px;
          position: relative;
          top: 1px;
          content: "\\ea06";
          border: none;
          font-family: "Grayic";
          font-size: 24px;
          transition: 0.4s;
          font-weight: 900;
          line-height: 14px;
        }
      }

      &:hover,
      &.active {
        > a {
          color: ${({ theme }) => theme.colors.primary} !important;
          text-decoration: none;
          &::after {
            transform: rotate(180deg);
          }
        }
      }
      &.dropdown {
        position: relative;

        &:hover {
          > .menu-dropdown {
            @media ${device.lg} {
              top: 10px;
              opacity: 1;
              pointer-events: visible;
              transform: translateX(-100%);
            }
          }
        }
        > .menu-dropdown {
          border-top-color: ${({ theme }) => theme.colors.success};
          @media ${device.lg} {
            top: 10px;
            left: 0%;
            opacity: 0;
            transform: translateX(-110%);
            transition: 0.4s;
            pointer-events: none;
          }
          > .drop-menu-item {
            @media ${device.lg} {
              padding-left: 30px;
              padding-right: 30px;
            }
          }
        }
      }
    }
    &.dropdown-right {
      left: auto;
      right: -90%;
    }
  `;

return (


<>
<motion.div>
    <Navbar collapseOnSelect expand="lg" fixed="top" bg="light">
    <Container>
    <HashLink to="/#" className='navbar-brand'> 
    <img
          alt="Pixie Bears"
          src={Logo}
          width="30"
          height="30"
          className="d-inline-block align-middle"
        />{' '}
      <span className="d-inline-block align-middle">Pixie Bears</span>
    </HashLink> 

    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
    <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="me-auto">
        </Nav>
        <Nav>
            <NavDropdown title="about" id="basic-nav-dropdown" href="/"
            show={show}
            onMouseEnter={showDropdown} 
            onMouseLeave={hideDropdown}
            >
            <HashLink className='dropdown-item' smooth to='/#story' >story</HashLink>
            <HashLink className='dropdown-item' smooth to='/#roadmap' >roadmap</HashLink>
            <HashLink className='dropdown-item' smooth to='/#team' >team</HashLink>
            <HashLink className='dropdown-item' smooth to='/#contact' >collaboration</HashLink>
            </NavDropdown>

            <NavLink className='nav-item nav-link disabled' to='/rarity'>rarity</NavLink>
            <NavLink className='nav-item nav-link disabled' to='/mint'>mint</NavLink>
            <NavLink className='nav-item nav-link disabled' to='/staking'>staking</NavLink>
            <NavLink className='nav-item nav-link disabled' to='/merch'>merch</NavLink>
           <NavLink className='nav-item nav-link' to='/faq'>FAQ</NavLink>
        </Nav>
    </Navbar.Collapse>
    </Container>
    </Navbar>
</motion.div>
</>


);


}


export default Header;
